import React from 'react';
import Slider from "react-slick";
import styles from './home.module.css';
import img1 from "../../assets/fp1.jpg";
import img2 from "../../assets/fp2.webp";
import img3 from "../../assets/fp3.jpeg";


export default function Home() {
  var settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    className: styles.slider
  };

  return (
    <Slider {...settings}>
      <div className={styles.slide}>
        <div className=<img src={img1} alt="img1"/> />
        <div className={styles.description}>
          <h2>Event 1</h2>
          <p>Description for Event 1</p>
        </div>
      </div>
      <div className={styles.slide}>
        <div className={`${styles.image} ${styles.rightImage}`} style={{backgroundImage: src=("../../assets/fp2.jpeg")}} />
        <div className={styles.description}>
          <h2>Event 2</h2>
          <p>Description for Event 2</p>
        </div>
      </div>
      <div className={styles.slide}>
        <div className={`${styles.image} ${styles.leftImage}`} style={{backgroundImage: src=("../../assets/fp3.jpeg")}} />
        <div className={styles.description}>
          <h2>Event 3</h2>
          <p>Description for Event 3</p>
        </div>
      </div>
    </Slider>
  );
}
